import React, {useState, useEffect} from "react";
import axios from "axios";
import { Link, Switch, Route } from 'react-router-dom';

function LookupResult(props) {

    const [customerList, setCustomerList] = useState([]);
    const name = props.name;

    // Need to update setName using props passed from Lookup inputs

    useEffect(()=> {
        axios.get("http://localhost:4000/customer/lookup", {
            params: { name }
            })
            .then(response => {
                setCustomerList(response.data)
                console.log(response.data)
            });
    }, []);

    return (
        <div>
            <h1>Lookup Result</h1>
            {customerList.map(customer => (
                <p key={customer.id}>
                    {customer.full_name} {customer.phone_number} {customer.license_plate}
                </p>
            ))}
        </div>
    );
}

export default LookupResult;
